    // productSelected.ticket = '00000'+this.pendingApprovals.length+1
    let addTicket = {...productSelected,'ticket':'000000'+this.pendingApprovals.length+1}
    this.pendingApprovals.push(productSelected)
    console.log(toJS(this.pendingApprovals))
  }
}
